import React from 'react';
import Card from 'react-bootstrap/Card';
import {Col} from 'react-bootstrap';
import {Button} from 'react-bootstrap'

const Contact = (props) => {
    return (
        
            <Col md="4" style={{marginBottom: "1rem"}}>
                        <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>Contact List</Card.Title>
                    <Card.Subtitle className="mb-2 text-muted">{props.ContactsInfo.name}</Card.Subtitle>
                    <Card.Text>
                    <p>Phone:{props.ContactsInfo.phone}</p>
                    <p>Location:{props.ContactsInfo.location}</p>
                    </Card.Text>
                    <Button style={{marginLeft: "1rem"}} variant="success" href="#">Edit</Button>
                    <Button style={{marginLeft: "1rem"}} variant="danger" href="#">Delete</Button>
                </Card.Body>
                </Card>
            </Col>  
    );
}

export default Contact;
